
            <!DOCTYPE HTML>
            <html lang="en">
            <head>
                <meta charset="UTF-8">
                <title>Profile Page</title>
                <meta name="viewport" content="width=device-width, initial-scale=1.0">
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.2/css/all.min.css">
                <style>
                    body {
                        font-family: Arial, sans-serif;
                        margin: 0;
                        padding: 0;
                        background-color: #f5f5f5;
                        display: flex;
                        justify-content: center;
                        align-items: center;
                        min-height: 100vh;
                    }
                    .container {
                        display: flex;
                        flex-direction: column;
                        background-color: white;
                        border-radius: 10px;
                        box-shadow: 0 4px 8px rgba(0,0,0,0.1);
                        padding: 20px;
                        width: 90%;
                        max-width: 900px;
                        margin: 20px auto;
                    }
                    .profile-left, .profile-right {
                        background-color: white;
                    }
                    .profile-left {
                        padding: 20px;
                        text-align: center;
                        width: 100%;
                    }
                    .profile-pic img {
                        width: 100px;
                        height: 100px;
                        border-radius: 50%;
                        object-fit: cover;
                        display: block;
                        margin: 0 auto;
                    }
                    .profile-info h1 {
                        margin: 20px 0 10px;
                        font-size: 2em;
                    }
                    .profile-info p {
                        margin: 0;
                        color: gray;
                    }
                    .profile-right {
                        padding: 20px;
                        width: 100%;
                        display: flex;
                        flex-direction: column;
                    }
                    .profile-button {
                        border: none;
                        border-radius: 10px;
                        padding: 15px;
                        margin: 10px 0;
                        text-align: center;
                        font-size: 1em;
                        display: flex;
                        justify-content: flex-start;
                        align-items: center;
                        cursor: pointer;
                        transition: transform 0.2s;
                    }
                    .profile-button:hover {
                        transform: scale(1.05);
                    }
                    .profile-button .icon {
                        font-size: 1.2em;
                        margin-right: 10px;
                    }
                    .fa-icon {
                        margin-right: 10px;
                    }
                    @media (max-width: 600px) {
                        body {
                            background-color: white;
                        }
                        .container {
                            width: 100%;
                        }
                        .profile-wrapper {
                            flex-direction: column;
                            align-items: center;
                        }
                        .profile-left, .profile-right {
                            width: 100%;
                            padding: 10px;
                            border: none;
                        }
                        .profile-right {
                            margin-top: 20px;
                            border-top: 1px solid #ddd;
                            padding-top: 20px;
                        }
                    }
                    @media (min-width: 600px) {
                        .container {
                            display: flex;
                            flex-direction: column;
                            align-items: center;
                        }
                        .profile-wrapper {
                            width: 100%;
                            padding: 20px;
                            display: flex;
                            flex-direction: row;
                            justify-content: center;
                        }
                        .profile-left, .profile-right {
                            width: 100%;
                            padding: 20px;
                            box-sizing: border-box;
                            max-width: 450px; /* Ensuring each section doesn't exceed half the container's width */
                        }
                        .profile-left {
                            border-right: 1px solid #ddd;
                        }
                    }
                    .profile-button {
                        border: none;
                        border-radius: 10px;
                        padding: 15px;
                        margin: 10px 0;
                        font-size: 1em;
                        display: flex;
                        align-items: center;
                        cursor: pointer;
                        transition: transform 0.2s, background-color 0.3s;
                        background-color: #007BFF;
                        color: #fff;
                        width: 100%;
                        box-sizing: border-box;
                        text-decoration: none;
                    }
                    .profile-button:hover {
                        transform: scale(1.05);
                        background-color: #0056b3;
                    }
                    .profile-button .icon {
                        font-size: 1.2em;
                        margin-right: 10px;
                    }
                    .profile-button span {
                        flex-grow: 1;
                        text-align: center;
                    }
                    .separator {
                        border-top: 1px solid #ddd;
                        margin: 20px 0;
                    }
                    .collapsible {
                        background-color: #007BFF;
                        color: white;
                        cursor: pointer;
                        padding: 18px;
                        width: 100%;
                        border: none;
                        text-align: left;
                        outline: none;
                        font-size: 15px;
                        border-radius: 8px; /* Making the corners round */
                    }
                    .active, .collapsible:hover {
                        background-color: #0056b3;
                    }
                    .content {
                        padding: 0 18px;
                        display: none;
                        overflow: hidden;
                        background-color: #f1f1f1;
                        border-radius: 8px; /* Making the corners round */
                    }
                </style>
            </head>
